import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <h1>Inventory Manager Pro</h1>
        <Routes>
          <Route path="/" element={<h2>Dashboard</h2>} />
          <Route path="/materials" element={<h2>Materials Page</h2>} />
          <Route path="/locations" element={<h2>Locations Page</h2>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
